import React, { Component } from "react";

// By extending the React.Component class, Counter inherits functionality from it
class HomePage extends Component {
    // Setting the initial state of the Counter component
    state = {
        count: 0
    };

    // handleIncrement increases this.state.count by 1
    handleIncrement = () => {
        // We always use the setState method to update a component's state
        this.setState({ count: this.state.count + 1 });
    };

    // handleDecrement decreases this.state.count by 1
    handleDecrement = () => {
        // We always use the setState method to update a component's state
        this.setState({ count: this.state.count - 1 });
    };

    // The render method returns the JSX that should be rendered
    render() {
        return (

            <div>

                <div id="carouselExampleSlidesOnly" class="carousel slide fullScreen" data-ride="carousel">
                    <div class="carousel-inner">
                        <div class="carousel-item">
                            <img src="https://static.giantbomb.com/uploads/original/0/2840/2495891-the-division_2013_06-10-13_008.jpg" class="d-block w-100" alt="..." />
                        </div>
                        <div class="carousel-item active">
                            <img src="https://wallpapercave.com/wp/gWAwDVv.jpg" class="d-block w-100" alt="..." />
                        </div>
                        <div class="carousel-item">
                            <img src="https://img.youtube.com/vi/BhTkoDVgF6s/maxresdefault.jpg" class="d-block w-100" alt="..." />
                        </div>
                    </div>
                </div>
            </div>

        );
    }
}

export default HomePage;
